import { Link } from 'react-router-dom';
import React from 'react';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Paper from '@material-ui/core/Paper';
import withStyles from '@material-ui/core/styles/withStyles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button'; 
import styles from './styles';

const firebase = require("firebase");

// Componente de registro

class SignupComponent extends React.Component{

    render(){

        const {classes } = this.props

        return(
            <main className={classes.main}>
                <CssBaseline></CssBaseline>
                <Paper className={classes.paper}>
                    <Typography component='h1' variant='h5'>
                        Registrarse
                    </Typography>
                    <form onSubmit={(e) => this.submitSignup(e)} className={classes.form}>
                        <FormControl required fullWidth margin="normal">
                            <InputLabel htmlFor="signup-email-input">Ingresa tu email</InputLabel>
                            <Input autoComplete='email' autoFocus id="signup-email-input"
                                onChange={(e) => this.userTyping('email', e)}
                            ></Input>
                        </FormControl>
                        <FormControl required fullWidth margin="normal">
                            <InputLabel htmlFor="signup-password-input">Crea tu contrase√±a</InputLabel>
                            <Input type="password" id="signup-password-input"
                                onChange={(e) => this.userTyping('password', e)}
                            ></Input>

                        </FormControl>
                    </form>
                </Paper>
            </main>
        )
    }

    //
    userTyping = (type, e) => {
        console.log(type, e)
    }

    // Sube el registro
    submitSignup = (e) => {
        console.log("A")
    }

}

export default withStyles(styles)(SignupComponent)
